    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE ( + col1 / - + col1 * + + 98 + col1 + + 49 - 68 ) IS NOT NULL;
  - name: tab1

outputs:
  - name: q5933.out
    data: |
      51	14	96
      85	5	59
      91	47	68
